import axios from 'axios';
import React from 'react'
import Chart from "react-apexcharts";


export default function ApexChart(){

  if (localStorage.getItem("token")) {
    const config = {
      headers: {
        "Content-Type": "application/json",
        Authorization: `token ${localStorage.getItem("token")}`,
        Accept: "application/json",
      },
    };

    const {data} =  axios.get(`http://127.0.0.1:8000/accounts/count/`,config)
    let FD = [data.data.FD]
    let emp = [data.data.employees]
}

    var options = {
        series: [emp,FD],
        labels: ["First Dose", "Second Dose", "Infected"]
    }
    // console.log("hello",props)
    return (
            <Chart options={options} series={options.series} type="pie" width={500} height={320} />
    )
}
